% LinearO03; generate a set of sample for Linear 
p = 50;
n = (p+2)*(p+1)/2;
H = zeros(n,3);
c = 1;
for i = 0:1:p
	for j = 0:1:p
		for k=0:1:p
			if i + j + k == p
				H(c, 1) = i / p;
				H(c, 2) = j / p;
				H(c, 3) = k / p;
				c = c+1;
			end
		end
	end	
end
LinearO03 = H;

